function uri() {
  return process.env.dev ? 'http://localhost:8081/api':
  'https://localhost:8081/api';
}
const API = {
  async get_profile(userID) {
    const result = await fetch(`${uri()}/profile/${userID}`);
    const json = await result.json();
    console.log(json.result);
    return json.result;
  }
}
export default API
